import axios from 'axios';
import React, {useEffect, useReducer,} from 'react';
import './App.css';

const initialcount =0;

const reduce = (state, action)=>{
  switch(action){
    case 'increment':
      return state+1
    case 'decrement':
      return state-1;
    case 'reset':
      return initialcount;
  }
}

export default function App(){
  const [state, dispatch] = useReducer(reduce, initialcount);

